Unfortunately, I cannot generate a regex for the specific webpage you mentioned as I cannot access external websites. However, a typical regex pattern for Iranian mobile numbers can be:

(\+98|0|98)?9\d{9}

This pattern matches Iranian mobile numbers that start with 9 and are followed by 9 digits. It allows for variations such as the country code +98, the initial 0, or simply 98 before the 9-digit mobile number.
